import{_ as p,o as e,c as t,R as a}from"./chunks/framework.S-lNut8w.js";const f=JSON.parse('{"title":"19","description":"","frontmatter":{"title":"19"},"headers":[],"relativePath":"05/019.md","filePath":"05/019.md"}'),_={name:"05/019.md"},o=a('<h1 id="_19" tabindex="-1">19 <a class="header-anchor" href="#_19" aria-label="Permalink to &quot;19&quot;">​</a></h1><p>那个黑衣人托起慕容紫玫软绵绵的身体，帮她套上衣服。尽管宫主有严令，但那人还是忍不住在玫瑰仙子幽香四溢的雪肤上悄悄捏了几把。纤足被陌生人攥住手心里揉捏，慕容紫玫又是恶心又是恼怒，恨恨瞪了他一眼。那人连忙放手，若无其事的站了起来，走到白玉莺身边，把早已勃起的阳具捅进她的小嘴里。</p><p>虽然不知道他为何大发善心，但穿上衣服，慕容紫玫心里顿时安安了许多。</p><p>风晚华此时却是身无寸缕。清露用剑脊在她赤裸的肉体上来回拖动，慢慢伸到腹下。白嫩的阴阜布满乌亮的毛发，微鼓鼓起，正中两片窄窄的红肉紧紧合拢着，没有一点缝隙。清露把弯曲的长剑平放在风晚华两腿间，剑尖拨开花瓣，缓缓向内探入。</p><p>风晚华仍是双目微闭，无动于衷的模样。清露心头火起，手中一紧，便欲刺入流霜剑处子体内。</p><p>「住手。」玄冰勉力叫道。他与风晚华硬拼一掌，受伤不轻，调息多时也未能制住丹田的剧痛。但看到清露如此暴殄天物，忍不住开声喝止。</p><p>玄冰位在清露之上，清露也不敢悍然下手，冷笑一声收起弯剑。</p><p>玄冰抬了抬手，自有几名帮众过来搀起他和烈焰。</p><p>吸了口气，玄冰缓缓道：「擒下玫瑰仙子和流霜剑，大伙功劳不小。先赶上霍长老，一道回宫。」</p><p>众人齐声应喏。</p><p>星月湖帮众在林里追踪了三天，此时大功告成，都是心花怒放。慕容紫玫是宫主禁脔，风晚华既是大名鼎鼎的女侠，又是处子之身，要等长老发话，这可苦了白玉莺。她抱着马颈，阴阜顶在马鞍边缘，两腿弯曲，敞露的秘处正对着男人的阳具。</p><p>那人也不动作，只靠马匹奔驰时快时慢的随意抽送。等他发泄完，便拎起白玉莺凌空扔给附近帮众。这一路她在马背上不停穿梭，但没有一次是坐在上面。</p><p>时而仰身平躺，时而被男人搂在怀中，时而蹲在鞍上——无论那种姿势，肉穴中始终抽着阳具。</p><p>清露有意折辱风晚华，特意挑了匹马，去掉马鞍，将风晚华赤身放在上面，用绳索穿过马腹将她两脚捆在一起。马匹突起的脊骨卡在肉缝中，正压住花蒂。</p><p>柔嫩的秘处顶毛发耸然的马背上，不住摩擦。</p><p>天色渐暮，一行人奔到大山边缘。烈焰和玄冰伤势难以抑制，脸色发灰，众人只好停下歇宿。</p><p>「呯」的一声，白玉莺被人从马上扔下来。她不住咯着血，手脚抽搐。倍受折磨的下体又红又肿，在腿间鼓成一团。浊白的精液不住涌出，沾在身下嫩绿的青草上。</p><p>众人对她毫不理会，只忙着安置各人的宿处。</p><p>「嘿，流霜剑真够骚的，流了这么多水儿！」一个汉子怪叫着掰开风晚华双腿，把玉户举到众人面前。</p><p>风晚华身体敏感，一路颠簸，使她密闭的花瓣翻卷开来，湿淋淋一片水光。</p><p>一群男人围着赤裸的风晚华指指点点淫声浪语不绝于耳，「什么流霜剑？不就是个流水儿的贱人嘛。」</p><p>「没人碰呢，都湿成这样，让大爷操几下，还不爽得尿出来？」</p><p>「寒月刀是她师妹吧，也浪着呢。几十号人操了一整天，她还直哼哼呢…」</p><p>十只手在风晚华身上四处乱摸，浑圆的乳房被捏得不住变形。有人甚至把手指伸进她滑腻的下体，浅浅捣弄。</p><p>慕容紫玫使劲眨了眨眼，把泪水硬压回去，侧脸看向一边。白玉莺的目光正朝这边看来，与她眼睛一触，立刻垂了下去。</p><p>看到她眼中的泪水和唇角的鲜血，紫玫的恨意渐渐消散。虽然出卖了自己，但小莺也很可怜……</p><p>清露分开众人，拖起风晚华放到紫玫身旁，笑道：「别怕那些家伙。风女侠阉了咱们霍长老，没他老人家发话，谁都不敢动你呢。」说着在风晚华下体掐了一把。</p><p>一路沉默的风晚华突然睁开双眼，目中精光大盛。</p><p>清露一惊，连忙抽身退开，手却被两条浑圆的大腿紧紧夹住。接着胸口如受雷击，一股刚猛的力道震碎护体真气，直入心脉。</p><p>风晚华一掌击倒清露，玉指由肩至踝快捷无伦的拂过紫玫七处被封的大穴，然后托在师妹腰间用力甩出。</p><p>紫玫浑身一震，凤凰宝典的真气立刻流动起来。她在空中回头望去，正看到师姐口中鲜血狂喷，仰身倒下。</p><p>慕容紫玫柔躯一旋，在空中划了个优美的圆弧，合身扑下，掌起肘落，已击倒两名星月湖帮众。她凤凰宝典已有小成，虽然难与长老级高手对抗，但对付这些帮众却是游刃有余。此时含怒出手，招术更是狠辣异常。纤手一沉击在一人下阴，那人根本没想到这个仙子般的小女孩会下此毒手，两眼一翻，便即毕命。</p><p>飘梅峰诸弟子以风晚华武功最高，俨然有宗师风范；林香远英气过人，与人对敌凌厉而不狠辣；纪眉妩性情温和，牵丝手招术细腻绵密，直如春风，温婉有余，刚劲不足；而紫玫身上却流着慕容家族的血液。</p><p>这个家族百年来数起数灭，说不尽的荣辱悲欢。但每个姓慕容的不仅相貌俊美，而且都有种奇异的活力。慕容家曾有一位先祖，十岁被封为大司马；十二岁国破被掳入敌宫，当做娈童；十余年后起兵反叛，自立为帝，数年中杀掠无数——慕容紫玫并不知道这些，但这股与生俱来的野性血液却使她迥异于三位师姐。</p><p>坐在风晚华身前的烈焰伤势未癒，此时见到慕容紫玫来势凶猛，只好出手抵挡。</p><p>紫玫劈手拧住他的手腕，皓腕一翻已将他的腕骨拧断，接着肘尖撞住胸口。烈焰伤上加伤，顿时一命呜呼。</p><p>慕容紫玫踢开烈焰的尸体，正待挽起师姐，却见眼前寒光闪动，余下的八名帮众拾起兵刃围了过来。紫玫斜身抢入，春葱般的玉指如兰花绽放，硬生生朝其中一把长剑夺去。</p><p>「住手！」旁边传来一声厉喝。</p><p>玄冰拿着清露的弯剑抵在风晚华喉头，「动一下我就杀了她！」</p><p>慕容紫玫两手握拳，美目喷火般怒视他。师姐拼着重伤冲开穴道救出自己，却因此落人敌手，毫无抵抗之力。</p><p>玄冰手一紧，剑锋刺入雪白的肌肤，「退到一边！」</p><p>紫玫恨不得掐死他，但只能依言退开。</p><p>「跪下！」</p><p>风晚华喉上渗出一缕鲜血，紫玫慢慢跪在地上。</p><p>「封了自己两腿和右臂的穴道！」</p><p>慕容紫玫秀眉一挑，却没有动作。</p><p>「封不封！」玄冰厉喝着，弯剑又刺入一分。</p><p>紫玫恶狠狠盯着他，咬牙道：「敢伤我师姐一根汗毛，我定把你们都碎尸万段！」</p><p>玄冰冷笑一声，左手探到风晚华下腹用力一拽，揪下一把带着血珠的阴毛扔到一边，然后拿起剑鞘抵住风晚华下体，叫道：「再不封住穴道，我可要给你师姐开苞了，流霜剑在江湖好大的名气，被剑鞘开了苞，也是武林中一桩趣事。」</p><p>「王八蛋！我慕容紫玫发誓：定要把你们一个个碎尸万段！挫骨扬灰！」慕容紫玫一抹眼泪，腾身而起，红衣飘飘宛如鲜花般飞入密林。</p><p>待慕容紫玫飞远，玄冰满脸的狞笑立刻消失得无影无踪。手指一松，弯剑掉在地上，喘着气说：「快走……」</p>',51),r=[o];function s(c,n,i,d,l,h){return e(),t("div",null,r)}const u=p(_,[["render",s]]);export{f as __pageData,u as default};
